INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 1, "カリン", 1, 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 1, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 3, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 4, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 2, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 5, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 6, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 7, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 2, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 8, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 9, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 10, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 11, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 12, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 2, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 13, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 14, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 15, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 16, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 0, "", 2, 17, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 2, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60000, 2, "カリン", 3, 18, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 60000, 3, "カリン", 3, 19, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 190804, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80001, 1, "ハツネ", 0, 20, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 101201, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80001, 2, "ハツネ", 0, 21, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 101201, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80001, 1, "シオリ", 1, 22, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 103801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80001, 2, "シオリ", 1, 23, "来年も、\n一緒にいられたら…\nうれしいな", 103801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80001, 1, "キョウカ", 0, 24, "あなたと一緒にいるようになって、\nもう1年ですか…", 103601, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80001, 2, "キョウカ", 0, 25, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 103601, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80001, 1, "ミミ", 1, 26, "おにいちゃんとあってから、\n1年たったよ～！", 102001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80001, 2, "ミミ", 1, 27, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 102001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80001, 1, "ミソギ", 2, 28, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 100401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80001, 2, "ミソギ", 2, 29, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 100401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80001, 1, "マホ", 0, 30, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 101001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80001, 2, "マホ", 0, 31, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 101001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80001, 1, "イリヤ", 1, 32, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 104401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80001, 2, "イリヤ", 1, 33, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 104401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80001, 1, "カオリ", 2, 34, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 101701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80001, 2, "カオリ", 2, 35, "これからも、どうぞよろしく\nお願いするさ～！", 101701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80001, 1, "サレン", 0, 36, "あんたと出会ってからもうそんなに\nたつのね～", 102801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80001, 2, "サレン", 0, 37, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 102801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80001, 1, "スズメ", 1, 38, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 102501, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80001, 2, "スズメ", 1, 39, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 102501, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80001, 1, "タマキ", 0, 40, "振り返れば、今までいろんなことが\nあったにゃあ…", 104601, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80001, 2, "タマキ", 0, 41, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 104601, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80001, 1, "ミフユ", 1, 42, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 104801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80001, 2, "ミフユ", 1, 43, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 104801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80001, 1, "アキノ", 0, 44, "あなたさまと出会ってもう1年…", 103201, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80001, 2, "アキノ", 0, 45, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 103201, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80001, 1, "ユカリ", 1, 46, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 103401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80001, 2, "ユカリ", 1, 47, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 103401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80001, 1, "クリスティーナ", 0, 48, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 107101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80001, 2, "クリスティーナ", 0, 49, "ともかくこれからも\n愉しませてくれよ☆", 107101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80001, 1, "ジュン", 1, 50, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 104701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80001, 2, "ジュン", 1, 51, "見えないから分からないって？\nそれもそうだな…", 104701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80001, 1, "トモ", 0, 52, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 103701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80001, 2, "トモ", 0, 53, "これからもよろしくね！", 103701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80001, 1, "マツリ", 1, 54, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 100501, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80001, 2, "マツリ", 1, 55, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 100501, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80001, 1, "ミヤコ", 0, 56, "オマエと会って1年なの！\n全然成仏もできなかったし、", 100701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80001, 2, "ミヤコ", 0, 57, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 100701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80001, 1, "シノブ", 1, 58, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 103101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80001, 2, "シノブ", 1, 59, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 103101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80001, 1, "アンナ", 0, 60, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 100901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80001, 2, "アンナ", 0, 61, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 100901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80001, 1, "ナナカ", 1, 62, "君と出会ってもう1年だって！\n早いねー！", 101301, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80001, 2, "ナナカ", 1, 63, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 101301, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80001, 1, "ミツキ", 0, 64, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 105101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80001, 2, "ミツキ", 0, 65, "これからも、いろんなところを\n調べさせてね？", 105101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80001, 1, "ルカ", 1, 66, "お前さんと出会ってもう1年か\n助太刀するつもりが", 105601, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80001, 2, "ルカ", 1, 67, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 105601, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80001, 1, "エリコ", 2, 68, "早いものですわね、あなた様と\nお会いして、もう1年…", 102701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80001, 2, "エリコ", 2, 69, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 102701, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80001, 1, "アヤネ", 0, 70, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 102301, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80001, 2, "アヤネ", 0, 71, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 102301, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80001, 1, "チカ", 1, 72, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 104201, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80001, 2, "チカ", 1, 73, "私のことを見守ってください\nできることなら、ずっと…", 104201, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80001, 1, "クルミ", 2, 74, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 102101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80001, 2, "クルミ", 2, 75, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 102101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80001, 1, "シズル", 0, 76, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 104901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80001, 2, "シズル", 0, 77, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 104901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80001, 1, "リノ", 1, 78, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 101101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80001, 2, "リノ", 1, 79, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 101101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80001, 1, "ユイ", 0, 80, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 100201, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80001, 2, "ユイ", 0, 81, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 100201, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80001, 1, "ヒヨリ", 1, 82, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 100101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80001, 2, "ヒヨリ", 1, 83, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 100101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80001, 1, "レイ", 2, 84, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 100301, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80001, 2, "レイ", 2, 85, "キミに背中を預けられる日が、\n早くきますように", 100301, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80001, 1, "ペコリーヌ", 0, 86, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80001, 2, "ペコリーヌ", 0, 87, "これからもずっと、覚えていて\nくださいね！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80001, 1, "コッコロ", 1, 88, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80001, 2, "コッコロ", 1, 89, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80001, 1, "キャル", 2, 90, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80001, 2, "キャル", 2, 91, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 1, "スズメ", 1, 92, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 112101, 1, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 93, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 94, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 95, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 96, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 97, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 2, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 98, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 99, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 100, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 101, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 102, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 2, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 103, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 104, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 105, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 106, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 107, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 108, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 109, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 2, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 110, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 111, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 112, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 113, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 114, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 115, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 0, "", 2, 116, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 2, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60001, 2, "スズメ", 3, 117, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 112101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 60001, 3, "スズメ", 3, 118, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 112101, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 1, "ペコリーヌ", 0, 119, "ヒューヒュー♪\nドンドンパフパフー♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 1, "コッコロ", 1, 120, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 2, "コッコロ", 1, 121, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 1, "キャル", 2, 122, "え？　ちょっと\nいきなりなにっ？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 2, "キャル", 2, 123, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 2, "ペコリーヌ", 0, 124, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 3, "ペコリーヌ", 0, 125, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 3, "コッコロ", 1, 126, "ですからその日に向けて\n今から気分を盛り上げているのです", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 3, "キャル", 2, 127, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 4, "コッコロ", 1, 128, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 4, "ペコリーヌ", 0, 129, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 4, "キャル", 2, 130, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80003, 5, "コッコロ", 1, 131, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 5, "キャル", 0, 132, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 1, "カリン", 1, 133, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 6, "キャル", 0, 134, "げっ…カリンじゃない\nなんでもないわよ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 2, "カリン", 1, 135, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 7, "キャル", 0, 136, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 3, "カリン", 1, 137, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 8, "キャル", 0, 138, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 9, "キャル", 0, 139, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 4, "カリン", 1, 140, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 10, "キャル", 0, 141, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 5, "カリン", 1, 142, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80003, 11, "キャル", 0, 143, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 6, "コッコロ", 0, 144, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 5, "ペコリーヌ", 1, 145, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 7, "コッコロ", 0, 146, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 8, "コッコロ", 0, 147, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 6, "ペコリーヌ", 1, 148, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 7, "ペコリーヌ", 1, 149, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 9, "コッコロ", 0, 150, "あとは、牧場に素敵な温泉が\n出来たとか…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 8, "ペコリーヌ", 1, 151, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 10, "コッコロ", 0, 152, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 9, "ペコリーヌ", 1, 153, "えへへ、ありがとうございます\nコッコロちゃん！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 11, "コッコロ", 0, 154, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80003, 10, "ペコリーヌ", 1, 155, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 11, "ペコリーヌ", 0, 156, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 12, "キャル", 1, 157, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 12, "ペコリーヌ", 0, 158, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 13, "キャル", 1, 159, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 13, "ペコリーヌ", 0, 160, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 14, "キャル", 1, 161, "…積極的？\nなんの話よ？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 14, "ペコリーヌ", 0, 162, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 15, "ペコリーヌ", 0, 163, "ムーサの町で\nきゃるきゃる～ん☆　って！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 15, "キャル", 1, 164, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 16, "ペコリーヌ", 0, 165, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 16, "キャル", 1, 166, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80003, 17, "キャル", 1, 167, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 18, "キャル", 0, 168, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 12, "コッコロ", 1, 169, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 19, "キャル", 0, 170, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 13, "コッコロ", 1, 171, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 20, "キャル", 0, 172, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 14, "コッコロ", 1, 173, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 21, "キャル", 0, 174, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 15, "コッコロ", 1, 175, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 22, "キャル", 0, 176, "かくし芸？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 16, "コッコロ", 1, 177, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80003, 23, "キャル", 0, 178, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 17, "ペコリーヌ", 0, 179, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 24, "キャル", 2, 180, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 17, "コッコロ", 1, 181, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 18, "ペコリーヌ", 0, 182, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 25, "キャル", 2, 183, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 18, "コッコロ", 1, 184, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 26, "キャル", 2, 185, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 27, "キャル", 2, 186, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 28, "キャル", 2, 187, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 19, "ペコリーヌ", 0, 188, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 19, "コッコロ", 1, 189, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80003, 29, "キャル", 2, 190, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 30, "キャル", 0, 191, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 31, "キャル", 0, 192, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 32, "キャル", 0, 193, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 33, "キャル", 0, 194, "あー\nあー\n…声、これで大丈夫かしら？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 34, "キャル", 0, 195, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 35, "キャル", 0, 196, "オイッスー☆", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 36, "キャル", 0, 197, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 37, "キャル", 0, 198, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80003, 38, "キャル", 0, 199, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 20, "コッコロ", 0, 200, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 21, "コッコロ", 0, 201, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 22, "コッコロ", 0, 202, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 23, "コッコロ", 0, 203, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 24, "コッコロ", 0, 204, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 25, "コッコロ", 0, 205, "オイッスー☆", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 26, "コッコロ", 0, 206, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 27, "コッコロ", 0, 207, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80003, 28, "コッコロ", 0, 208, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 20, "ペコリーヌ", 0, 209, "オイッスー☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 21, "ペコリーヌ", 0, 210, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 22, "ペコリーヌ", 0, 211, "あと６日で2.5周年ですか…", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 23, "ペコリーヌ", 0, 212, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 24, "ペコリーヌ", 0, 213, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 25, "ペコリーヌ", 0, 214, "オイッスー☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 26, "ペコリーヌ", 0, 215, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 27, "ペコリーヌ", 0, 216, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 28, "ペコリーヌ", 0, 217, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 29, "ペコリーヌ", 0, 218, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80003, 30, "ペコリーヌ", 0, 219, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 31, "ペコリーヌ", 0, 220, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 29, "コッコロ", 1, 221, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 32, "ペコリーヌ", 0, 222, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 39, "キャル", 2, 223, "…………", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 30, "コッコロ", 1, 224, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 40, "キャル", 2, 225, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 33, "ペコリーヌ", 0, 226, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 41, "キャル", 2, 227, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 34, "ペコリーヌ", 0, 228, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 35, "ペコリーヌ", 0, 229, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 42, "キャル", 2, 230, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 31, "コッコロ", 1, 231, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 43, "キャル", 2, 232, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80003, 36, "ペコリーヌ", 0, 233, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 6, "カリン", 0, 234, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 7, "カリン", 0, 235, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 8, "カリン", 0, 236, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 9, "カリン", 0, 237, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 10, "カリン", 0, 238, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 11, "カリン", 0, 239, "次にコッコロさんですが\nこちらは発声練習をしています", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 12, "カリン", 0, 240, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 13, "カリン", 0, 241, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 14, "カリン", 0, 242, "あれ？\nもしかして緊張で気を失って…？", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 15, "カリン", 0, 243, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 16, "カリン", 0, 244, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80003, 17, "カリン", 0, 245, "それでは\nまた明日お会いしましょう♪", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 44, "キャル", 0, 246, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 37, "ペコリーヌ", 2, 247, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 32, "コッコロ", 1, 248, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 45, "キャル", 0, 249, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 38, "ペコリーヌ", 2, 250, "ひどいですよぉキャルちゃ～ん！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 33, "コッコロ", 1, 251, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 39, "ペコリーヌ", 2, 252, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 46, "キャル", 0, 253, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 34, "コッコロ", 1, 254, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80003, 40, "ペコリーヌ", 2, 255, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 41, "ペコリーヌ", 0, 256, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 47, "キャル", 2, 257, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 42, "ペコリーヌ", 0, 258, "忘れてきちゃいました☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 48, "キャル", 2, 259, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 35, "コッコロ", 1, 260, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 49, "キャル", 2, 261, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 43, "ペコリーヌ", 0, 262, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 50, "キャル", 2, 263, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 36, "コッコロ", 1, 264, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 51, "キャル", 2, 265, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 37, "コッコロ", 1, 266, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 52, "キャル", 2, 267, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 44, "ペコリーヌ", 0, 268, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 38, "コッコロ", 1, 269, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 45, "ペコリーヌ", 0, 270, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 53, "キャル", 2, 271, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80003, 46, "ペコリーヌ", 0, 272, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 18, "カリン", 0, 273, "こんにちは\n【ギルド管理協会】のカリンです", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 19, "カリン", 0, 274, "昨日の生放送は\nいかがだったでしょうか？", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 20, "カリン", 0, 275, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 21, "カリン", 0, 276, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 22, "カリン", 0, 277, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 23, "カリン", 0, 278, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 24, "カリン", 0, 279, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 25, "カリン", 0, 280, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 26, "カリン", 0, 281, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80003, 27, "カリン", 0, 282, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 47, "ペコリーヌ", 0, 283, "準備はいいですかっ？\n…いっきますよー！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 54, "キャル", 2, 284, "祝！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 39, "コッコロ", 1, 285, "2.5周年！", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 48, "ペコリーヌ", 0, 286, "おめでとうございま～す☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 55, "キャル", 2, 287, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 40, "コッコロ", 1, 288, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 49, "ペコリーヌ", 0, 289, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 56, "キャル", 2, 290, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 41, "コッコロ", 1, 291, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 57, "キャル", 2, 292, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 50, "ペコリーヌ", 0, 293, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 58, "キャル", 2, 294, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 51, "ペコリーヌ", 0, 295, "記念日だから\n平気平気♪\nやばいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 59, "キャル", 2, 296, "意味分かんないわよ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 42, "コッコロ", 1, 297, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 43, "コッコロ", 1, 298, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 52, "ペコリーヌ", 0, 299, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 60, "キャル", 2, 300, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 44, "コッコロ", 1, 301, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80003, 53, "ペコリーヌ", 0, 302, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "105901,45,106001,61", 80003, 54, "ペコリーヌ・コッコロ・キャル", 0, 303, "2.5周年\nありがとうございます！", 105801, 0, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 1, "カリン", 1, 304, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 1, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 305, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 306, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 307, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 308, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 309, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 2, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 310, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 311, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 312, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 313, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 314, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 2, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 315, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 316, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 317, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 318, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 319, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 320, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 321, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 2, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 322, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 323, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 324, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 325, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 326, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 327, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 0, "", 2, 328, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 2, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60002, 2, "カリン", 3, 329, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 60002, 3, "カリン", 3, 330, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 190804, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 1, "コッコロ", 4, 331, "ささ、シェフィさまはこちらへ…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 1, "シェフィ", 0, 332, "コッコロさん、どこへ行くの…？\n…え？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 1, "ペコリーヌ", 3, 333, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 2, "コッコロ", 4, 334, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 2, "シェフィ", 0, 335, "ええと…\n二人とも何をしているの？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 1, "キャル", 1, 336, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 3, "シェフィ", 0, 337, "あの日…？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 2, "ペコリーヌ", 3, 338, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 3, "ペコリーヌ", 3, 339, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 1, "カリン", 2, 340, "やばいですね☆", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 2, "キャル", 1, 341, "って、なにしれっと\n参加してんのよカリン！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 2, "カリン", 2, 342, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 3, "カリン", 2, 343, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 4, "ペコリーヌ", 3, 344, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (1, "", 80005, 4, "シェフィ", 0, 345, "えっ！？　ええとええと…！\nあ、あと14日…！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 5, "ペコリーヌ", 3, 346, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 3, "コッコロ", 1, 347, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 4, "コッコロ", 1, 348, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 6, "ペコリーヌ", 3, 349, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 5, "コッコロ", 1, 350, "さすがでございます\nペコリーヌさま", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 3, "キャル", 0, 351, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 5, "シェフィ", 2, 352, "しゃなり、しゃなり…\nふふ、案外できるものね", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 7, "ペコリーヌ", 3, 353, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 6, "コッコロ", 1, 354, "さ、次はキャルさまの\n番でございますよ", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 4, "キャル", 0, 355, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 6, "シェフィ", 2, 356, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 5, "キャル", 0, 357, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 6, "キャル", 0, 358, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 7, "コッコロ", 1, 359, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (2, "", 80005, 7, "キャル", 0, 360, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 8, "コッコロ", 1, 361, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 8, "ペコリーヌ", 3, 362, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 9, "コッコロ", 1, 363, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 7, "シェフィ", 2, 364, "聖学祭…って、なにかしら？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 10, "コッコロ", 1, 365, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 8, "キャル", 0, 366, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 9, "キャル", 0, 367, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 9, "ペコリーヌ", 3, 368, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 10, "キャル", 0, 369, "いや、そのまんますぎでしょ…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 8, "シェフィ", 2, 370, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 10, "ペコリーヌ", 3, 371, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (3, "", 80005, 9, "シェフィ", 2, 372, "えっ？　ええ…\nぎゅーっ…？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 11, "キャル", 0, 373, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 10, "シェフィ", 2, 374, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 12, "キャル", 0, 375, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 11, "コッコロ", 1, 376, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 13, "キャル", 0, 377, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 11, "ペコリーヌ", 3, 378, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 14, "キャル", 0, 379, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 15, "キャル", 0, 380, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 11, "シェフィ", 2, 381, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 12, "ペコリーヌ", 3, 382, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 12, "コッコロ", 1, 383, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 16, "キャル", 0, 384, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (4, "", 80005, 12, "シェフィ", 2, 385, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 13, "ペコリーヌ", 3, 386, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 14, "ペコリーヌ", 3, 387, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 15, "ペコリーヌ", 3, 388, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 17, "キャル", 0, 389, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 18, "キャル", 0, 390, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 13, "シェフィ", 2, 391, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 13, "コッコロ", 1, 392, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 16, "ペコリーヌ", 3, 393, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 19, "キャル", 0, 394, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 17, "ペコリーヌ", 3, 395, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 18, "ペコリーヌ", 3, 396, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (5, "", 80005, 19, "ペコリーヌ", 3, 397, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 4, "カリン", 2, 398, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 5, "カリン", 2, 399, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 20, "キャル", 1, 400, "…えっ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 20, "ペコリーヌ", 3, 401, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 14, "シェフィ", 0, 402, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 14, "コッコロ", 4, 403, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 15, "シェフィ", 0, 404, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 21, "キャル", 1, 405, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 21, "ペコリーヌ", 3, 406, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 22, "キャル", 1, 407, "ぶっ殺すぞ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (6, "", 80005, 6, "カリン", 2, 408, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 15, "コッコロ", 1, 409, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 23, "キャル", 0, 410, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 16, "シェフィ", 2, 411, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 22, "ペコリーヌ", 3, 412, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 24, "キャル", 0, 413, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 17, "シェフィ", 2, 414, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 16, "コッコロ", 1, 415, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 18, "シェフィ", 2, 416, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 17, "コッコロ", 1, 417, "もちろんでございます\n仲良くお勉強いたしましょう", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 25, "キャル", 0, 418, "しれっと教育ママが\n生まれてる…？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 23, "ペコリーヌ", 3, 419, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (7, "", 80005, 26, "キャル", 0, 420, "え～～～～！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 27, "キャル", 0, 421, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 19, "シェフィ", 2, 422, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 18, "コッコロ", 1, 423, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 24, "ペコリーヌ", 3, 424, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 20, "シェフィ", 2, 425, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 28, "キャル", 0, 426, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 19, "コッコロ", 1, 427, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 21, "シェフィ", 2, 428, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 29, "キャル", 0, 429, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 30, "キャル", 0, 430, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 25, "ペコリーヌ", 3, 431, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (8, "", 80005, 31, "キャル", 0, 432, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 22, "シェフィ", 0, 433, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 23, "シェフィ", 0, 434, "…えっ？\n生放送の意気込み！？\n突然なに！？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 24, "シェフィ", 0, 435, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 25, "シェフィ", 0, 436, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 26, "シェフィ", 0, 437, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 27, "シェフィ", 0, 438, "それから、それから…！\nぅ、ぅぅっ…！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 28, "シェフィ", 0, 439, "―びえぇぇ～んっ！！！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 20, "コッコロ", 1, 440, "どうされましたか、シェフィさま", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 29, "シェフィ", 0, 441, "ううっ…ひっく…\nママッ…！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 21, "コッコロ", 1, 442, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 22, "コッコロ", 1, 443, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (9, "", 80005, 30, "シェフィ", 0, 444, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 23, "コッコロ", 0, 445, "主さま\n3.5周年まであと５日\nでございます", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 24, "コッコロ", 0, 446, "ですがその前に\n生放送がありますね", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 25, "コッコロ", 0, 447, "…生放送に向けた\n意気込みでございますか？", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 26, "コッコロ", 0, 448, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 27, "コッコロ", 0, 449, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 28, "コッコロ", 0, 450, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 29, "コッコロ", 0, 451, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 30, "コッコロ", 0, 452, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (10, "", 80005, 31, "コッコロ", 0, 453, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 26, "ペコリーヌ", 0, 454, "3.5周年まであと４日！\nやばいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 32, "キャル", 1, 455, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 27, "ペコリーヌ", 0, 456, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 28, "ペコリーヌ", 0, 457, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 29, "ペコリーヌ", 0, 458, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 33, "キャル", 1, 459, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 30, "ペコリーヌ", 0, 460, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 31, "ペコリーヌ", 0, 461, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 32, "ペコリーヌ", 0, 462, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 34, "キャル", 1, 463, "だからあたしはやるなんて一言も…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 33, "ペコリーヌ", 0, 464, "オイッスー☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (11, "", 80005, 35, "キャル", 1, 465, "聞きなさいっての！！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 31, "シェフィ", 2, 466, "3.5周年まであと３日…\nそして生放送は、明日…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 32, "シェフィ", 2, 467, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 33, "シェフィ", 2, 468, "おいっす！\n…こうじゃなかったわね\nええと確か…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 34, "シェフィ", 2, 469, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 35, "シェフィ", 2, 470, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 34, "ペコリーヌ", 3, 471, "やってますねシェフィちゃん！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 36, "キャル", 0, 472, "なによ、考えることは\nみんな同じってこと？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 32, "コッコロ", 1, 473, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 36, "シェフィ", 2, 474, "みんな…もちろんよ！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (12, "", 80005, 35, "ペコリーヌ", 3, 475, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 7, "カリン", 2, 476, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 8, "カリン", 2, 477, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 36, "ペコリーヌ", 3, 478, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 9, "カリン", 2, 479, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 33, "コッコロ", 4, 480, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 10, "カリン", 2, 481, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 37, "キャル", 1, 482, "大丈夫…大丈夫…\nあたしは大丈夫…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 11, "カリン", 2, 483, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 37, "シェフィ", 0, 484, "あうー？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "105901,34,106001,38,190801,12", 80005, 37, "みんな", 4, 485, "あ…", 105801, 0, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 39, "キャル", 1, 486, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 35, "コッコロ", 4, 487, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 38, "ペコリーヌ", 3, 488, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (13, "", 80005, 13, "カリン", 2, 489, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 38, "シェフィ", 2, 490, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 39, "ペコリーヌ", 3, 491, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 40, "キャル", 0, 492, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 36, "コッコロ", 1, 493, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 39, "シェフィ", 2, 494, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 40, "ペコリーヌ", 3, 495, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 37, "コッコロ", 1, 496, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 41, "キャル", 0, 497, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 40, "シェフィ", 2, 498, "へ、へぇ…", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 41, "ペコリーヌ", 3, 499, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 41, "シェフィ", 2, 500, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (14, "", 80005, 42, "シェフィ", 2, 501, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 42, "ペコリーヌ", 3, 502, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 42, "キャル", 1, 503, "祝！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 38, "コッコロ", 4, 504, "3.5周年！", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 43, "シェフィ", 0, 505, "おめでとうございます！", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 14, "カリン", 2, 506, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 15, "カリン", 2, 507, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 190801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 43, "ペコリーヌ", 3, 508, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 44, "ペコリーヌ", 3, 509, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 43, "キャル", 1, 510, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 44, "キャル", 1, 511, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 106001, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 44, "シェフィ", 0, 512, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 45, "シェフィ", 0, 513, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 106401, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 39, "コッコロ", 4, 514, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 40, "コッコロ", 4, 515, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 41, "コッコロ", 4, 516, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 105901, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "", 80005, 45, "ペコリーヌ", 3, 517, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 105801, 0, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (15, "105901,42,106001,45,106401,46,190801,16", 80005, 46, "みんな", 4, 518, "これからも\nよろしくおねがいします！", 105801, 0, 0, 1);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 1, "カリン", 1, 519, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 190804, 1, 0, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 520, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 521, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 522, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 523, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 1, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 524, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 2, 1, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 525, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 526, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 527, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 528, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 1, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 529, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 2, 2, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 530, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 531, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 532, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 533, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 534, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 535, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 1, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 536, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 2, 3, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 537, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 538, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 539, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 540, "今日の運勢は小吉！　難しい頼み事をされるかもしれません！　　うまくやれればきっと成長につながります、挑戦してみましょう！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 541, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 542, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 1, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 0, "", 2, 543, "今日の運勢は小吉！　無理は禁物、お家で静かにしていましょう　プロぼっちの私が、お家での過ごし方……教えてあげましょうか？", 0, 2, 4, 0);
INSERT INTO `v1_f3e0d0469f888168dfc039dea9bf6c31d75b9d5fbf6a1a521bedca68e3fd1f77` VALUES (0, "", 60003, 2, "カリン", 3, 544, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 190804, 0, 0, 0);
